    <div className="joinOuterContainer">
      <div className="joinInnerContainer">
        <div className='welcome'>
          <h1>Welcome to the Chat room</h1>
        </div>
        <Link to={`/login/}`}>
          <p>To Login</p>
        </Link>
      </div>
    </div>
  );
}
